import React from 'react';
import { View, StyleSheet } from 'react-native';

const HomeIcons = () => {
    return (
        <View style={styles.h_icons}>
            <View>
                <Text>Home</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    h_icons: {
        width: '100vw',
        height: '20px',
        backgroundColor: "#f0f0f0"
    }
})

export default HomeIcons;
